import 'package:dio/dio.dart';
import 'package:get_storage/get_storage.dart';
import 'package:mobile/core/constants/error/alert_error.dart';
import 'package:mobile/core/init/cache/get_storege.dart';
import 'package:mobile/core/network/dio/dio_client.dart';
import 'package:mobile/core/network/dio/endpoints.dart';
import 'package:mobile/models/bio_identification_model.dart';
import 'package:mobile/models/phone_registration.dart';

class BioIdentificationService {
  static final BioIdentificationService _instance =
      BioIdentificationService._init();
  static BioIdentificationService get instance => _instance;
  Future<BioIdentificationModel> postBioIdentification(String image,
      String seriyes, String seriyesNumber, String birthDate) async {
    var _data = {
      "birth_date": birthDate,
      "doc_number": seriyesNumber,
      "doc_series": seriyes.toUpperCase(),
      "doc_type": 1,
      "photo": {"front": "data:image/png;base64," + image}
    };
    var data = {
      "birth_date": "1996-03-03",
      "doc_number": "3339379",
      "doc_series": "AA",
      "doc_type": 1,
      "photo": {
        "front":
            "data:image/jpeg;base64,"
      }
    };
    try {
      final response = await DioClient.instance
          .post('${Endpoints.baseUrl}${Endpoints.bioIdentification}',
              data: _data,
              options: Options(
                headers: Endpoints.headers(),
              ));
      return BioIdentificationModel.fromJson(response);
    } catch (e) {
      throw e;
    }
  }

  BioIdentificationService._init();
}
